<template>
	<view>

		<view class="zhezhao" v-if="password_input">
			<view class="input-wrap">
				<view>请输入余额支付密码</view>
				<input type="password" placeholder="请输入密码" @blur="user_password">
				<view class="btns">
					<view @click="cancelInput" class="btn">取消</view>
					<view @click="confirmInput" class="btn">确定</view>
				</view>
			</view>
		</view>
		<view class="titleImg">
			<image src="data:image/jpeg;base64," mode=""></image>
		</view>

		<block v-if="pro.dis_level[0].Level_LimitType==5">
			<block  v-if="pro.dis_config.Level_Form">
				<view class="center" v-if="pro.dis_level[0].Distribute_Form.DisplayName==1">
								<view class="mbx">
									姓名
								</view>
								<input type="text" placeholder="请输入您的姓名" placeholder-style="color: #CAC8C8;" v-model="shenArr.DisplayName">
					</view>
					<view class="center" v-if="pro.dis_level[0].Distribute_Form.DisplayTelephone==1">
								<view class="mbx">
									电话
								</view>
								<input type="text" placeholder="请输入您的电话" placeholder-style="color: #CAC8C8;" v-model="shenArr.DisplayTelephone" @blur="isTell">
					</view>
				<!-- 	<block v-for="(itm,idx) of select_lists" :key="idx" >
							<view class="section">
							  <picker :value="itm.index" mode="selector" :range="itm.options"  @change="selectS(idx,$event)">
								<view class="picker">
								{{itm.options[itm.index]}}
								</view>
							  </picker>
							</view>
					 </block> -->
					 <view class="center" v-for="(itm,idx2) of select_lists" :key="idx2">
					 			<view class="mbx">
					 				{{itm.name}}
					 			</view>
					 			<view class="haha">
					 			  <picker :value="itm.index" mode="selector" :range="itm.options"  @change="selectS(idx2,$event)">
										<view class="picker">
										{{itm.options[itm.index]}}
										</view>
					 			  </picker>
					 			</view>
					 </view>
					 <view class="center" v-for="(m,n) of text_lists" :key="n">
					 			<view class="mbx">
					 				{{m.Name}}
					 			</view>
					 			<input type="text" v-model="m.Value" >
					 </view>
					<view class="center" v-if="pro.dis_level[0].Distribute_Form.DisplayLocaltion==1">
								<view class="mbx">
									区域选择
								</view>
								<view class="haha">
									<!-- 选择区域 -->
									<picker mode="multiSelector"  @change="bindMultiPickerChange" @columnchange="bindMultiPickerColumnChange" :value="change_multiIndex" :range="change_objectMultiArray" range-key="name">
													<view class="picker" style="text-align: center;">
													  <view v-if="!address_info.Address_Province">选择省份</view>
													  <view v-else>{{objectMultiArray[0][multiIndex[0]]['name']}}</view>
													  <view v-if="!address_info.Address_City">选择城市</view>
													  <view v-else>{{objectMultiArray[1][multiIndex[1]]['name']}}</view>
													  <view v-if="!address_info.Address_Area">选择地区</view>
													  <view v-else>{{objectMultiArray[2][multiIndex[2]]['name']}}</view>
													</view>
									</picker>
								</view>
					</view>
					<view class="center" v-if="pro.dis_level[0].Distribute_Form.DisplayLocaltion==1">
								<view class="mbx">
									选择街道
								</view>
								<view class="haha">
								  <picker mode="selector" @change="t_pickerChange" :range="t_arr" range-key="name" :value="t_index">
									<view class="picker">
									<!--  <text style="font-size: 28upx;">街道地址</text> -->
									  <view v-if="!address_info.Address_Town" style="margin-left: 20upx;width: 300upx;">选择街道</view>
									  <view v-else style="margin-left: 20upx;width: 300upx;">{{t_arr[t_index]['name']}}</view>
									</view>
								  </picker>
								</view>
					</view>
			</block>


			<view class="checks" v-if="pro.dis_config.Distribute_AgreementOpen">
					<radio @click="changes" :checked="isAgree" style="transform:scale(0.7)"/><text @click="goDistributeAgreement">同意<text  class="checkq" >{{pro.dis_config.Distribute_AgreementTitle}}</text></text>
			</view>

			<view class="submits" @click="application">
				{{textShen}}
			</view>
<!-- 
			<view class="zhezhao" v-if="isXu">
				<view class="zhezhaoText">
					<image @click="isXu=false" src="data:image/png;base64," ></image>
					<view class="zhezhaoTitle">
						购买须知
					</view>
					<view class="zhezhaoAic">
						1、游客入住酒店后如需升级或者更换房型，需补交升级或者更换的房差费用。
					</view>
				</view>
			</view> -->
		</block>




		<view  class="disConfig" v-else-if="pro.dis_config.Distribute_Type==2&&pro.dis_level[0].Level_LimitType==2">
			<block v-for="(fen,ins) of pro.dis_level" :key="ins">
				<view class="line" v-if="ins!=0"></view>
				<view class="fenxiao">
					{{fen.Level_Name}}<text>({{fen.Level_LimitValue[0]==0?'购买任意商品':'购买以下任意商品'}})</text>
				</view>
				<block v-if="fen.Level_LimitValue[0]==0">
					<view class="isFenxiao" @click="goResult">
						进入商城
					</view>
				</block>
				<block v-else>
					<view class="pro">
						<view class="forOf" v-for="(m,n) of fen.prod_list" :key="n" @click="goDetail(m.Products_ID)">
							<view class="imgs">
								<image :src="m.ImgPath"></image>
							</view>
							<view class="text">
								{{m.Products_Name}}
							</view>
							<view class="prices">
								¥<text>{{m.Products_PriceX}}</text>
							</view>
						</view>
					</view>
				</block>
			</block>
		</view>
		<block v-else-if="pro.dis_config.Distribute_Type==1&&pro.dis_level[0].Level_LimitType==1">
			<block v-for="(fo,ind) of pro.dis_level" :key="ind">
				<view class="line" v-if="ind!=0"></view>
				<view class="fenxiao">
					{{fo.Level_Name}}<text>({{fo.Level_LimitValue[0]==0?'商城总消费':'一次性消费'}}<text>{{fo.Level_LimitValue[1]}}</text>)</text>
				</view>
				<block>
					<view class="isFenxiao" @click="goResult">
						进入商城
					</view>
				</block>
			</block>
		</block>

		<block v-else-if="pro.dis_config.Distribute_Type==0&&pro.dis_level[0].Level_LimitType==0">
			<block v-if="pro.dis_config.Level_Form">
				<view class="center" v-if="pro.dis_level[0].Distribute_Form.DisplayName==1">
							<view class="mbx">
								姓名
							</view>
							<input type="text" placeholder="请输入您的姓名" placeholder-style="color: #CAC8C8;" v-model="shenArr.DisplayName">
				</view>
				<view class="center" v-if="pro.dis_level[0].Distribute_Form.DisplayTelephone==1">
							<view class="mbx">
								电话
							</view>
							<input type="text" placeholder="请输入您的电话" placeholder-style="color: #CAC8C8;" v-model="shenArr.DisplayTelephone" @blur="isTell">
				</view>
				<view class="center" v-for="(itm,idx) of select_lists" :key="idx">
							<view class="mbx">
								{{itm.name}}
							</view>
							<view class="haha">
							  <picker :value="itm.index" mode="selector" :range="itm.options"  @change="selectS(idx,$event)">
												<view class="picker">
												{{itm.options[itm.index]}}
												</view>
							  </picker>
							</view>
				</view>
				<view class="center" v-for="(m,n1) of text_lists" :key="n1">
							<view class="mbx">
								{{m.Name}}
							</view>
							<input type="text" v-model="m.Value" :placeholder="'请输入'+m.Name">
				</view>
			</block>
			<radio-group >
				<label class="uni-list-cell " v-for="(item, index) in pro.dis_level" :key="index" @click="payFenId(index)">
					<view>
						<radio style="transform: scale(0.8);" :value="item.Level_Name" :checked="index === current" />
					</view>
					<view>{{item.Level_Name}}({{item.Level_LimitType==0?'商城总消费':'一次性消费'}}{{item.Level_LimitValue}}元)</view>
				</label>
			</radio-group>
			<view class="checks" v-if="pro.dis_config.Distribute_AgreementOpen">
				<radio @click="changes" :checked="isAgree" style="transform:scale(0.7)"/><text  @click="goDistributeAgreement">同意<text  class="checkq" >{{pro.dis_config.Distribute_AgreementTitle}}</text></text>
			</view>
			<view class="submits" @click="becomeFenxiao">
				立即购买成为分销商
			</view>
		</block>
		
		<view  class="disConfig" v-else-if="pro.dis_config.Distribute_Type==4&&pro.dis_level[0].Level_LimitType==4">
			<block v-for="(fen,ins) of pro.dis_level" :key="ins">
				<view class="line" v-if="ins!=0"></view>
				<view class="fenxiao">
					{{fen.Level_Name}}<text>(购买商品{{fen.Product_Num}}次)</text>
				</view>
				<block v-if="fen.Level_LimitValue[0]==0">
					<view class="isFenxiao" @click="goResult">
						进入商城
					</view>
				</block>
			</block>	
		</view>		
		<popup-layer ref="popupLayer" :direction="'top'">
			<div class="iMbx">
				<div class="c_method" v-for="(item,index) in pay_arr" @click="chooseType(index)" :key="index">
					{{item}} <text>￥{{pay_money}}</text>
				</div>
			</div>
		</popup-layer>
	</view>
</template>

<script>
	import {pageMixin} from "../../common/mixin";
	import {disApplyInit,getTown,disApply,disBuy,orderPay} from '../../common/fetch.js';
	import area from '../../common/area.js';
	import utils from '../../common/util.js';
	import popupLayer from '../../components/popup-layer/popup-layer.vue'
	import {mapGetters,mapActions} from 'vuex';
	import {
		ls,
		GetQueryByString,
		isWeiXin,
		urlencode
	} from "../../common/tool";
	import {toast} from "../../common";
	export default {
		mixins:[pageMixin],
		components: {
			popupLayer
		},
		data() {
			return {
				textShen:'立即申请成为分销商',
				isXu:false,//是否弹出购买须知
				isAgree:false,//是否同意
				pro:[],
				change_objectMultiArray: [],  //选择数据
				address_info:{},
				objectMultiArray: [],   //展示数据
				multiIndex: [0, 0, 0],  //选择数据
				change_multiIndex: [0, 0, 0], //改变的收货地址对应列的下标
				current:0,
				// 街道信息
				t_arr: [],
				t_index: 0,
				shenArr:{
					DisplayName:'',
					DisplayTelephone:''
				},
				forIndex:0,
				select_lists:'',//填写下拉选
				disLevelInfo:'',
				text_lists:'',//填写文本框
				submitM:false,
				pay_arr:[],//支付方式
				password_input:false,//弹出密码输入框
				user_pay_password:'',//用户输入的密码
				code:'',//code
				JSSDK_INIT: false,
				pay_type:'',//支付方式
				pay_money:0,//支付金额
			};
		},
		computed:{
			...mapGetters(['userInfo']),
		},
		onLoad() {
			//如果用户手机号登录获取code
			let that=this;
			// if(!this.userInfo.openid){
			// 	uni.login({
			// 		 provider: 'weixin',
			// 		  success: function (loginRes) {
			// 			  that.code=loginRes.code;
			// 		  }
			// 	})
			// }
			this.disApplyInit();
			this.objectMultiArray = [
			  utils.array_change(area.area[0]['0']),
			  utils.array_change(area.area[0]['0,1']),
			  utils.array_change(area.area[0]['0,1,35'])
			];
			this.change_objectMultiArray = [
			  utils.array_change(area.area[0]['0']),
			  utils.array_change(area.area[0]['0,1']),
			  utils.array_change(area.area[0]['0,1,35'])
			];
			//获取支付方式
			this.pay_arr = ls.get('initData').pay_arr;
		},
		methods:{
			//查看须知
			goDistributeAgreement(){
				uni.navigateTo({
					url:'../distributeAgreement/distributeAgreement'
				})
			},
			// 取消输入支付密码
			cancelInput() {
				this.password_input = false;
			},
			// 用户输入密码完毕
			user_password(e) {
				this.user_pay_password = e.detail.value;
			},
			// 确定输入支付密码
			confirmInput(e) {
				// this.self_orderPay();
				this.password_input = false;
				//提交信息
				this.disBuy();
			},
			payFenId(index){
				this.current=index;
				this.pay_money=this.pro.dis_level[index].Level_LimitValue;
			},
			//选择支付方式
			chooseType(index){
				this.pay_type=index;
				if(index=='remainder_pay'){
					this.$refs.popupLayer.close();
					this.password_input=true;//弹出密码输入框
					return;
				}

				this.disBuy();
			},
			paySuccessCall(){
				toast('成为经销商');
				setTimeout(function () {
					uni.switchTab({
						url:'../fenxiao/fenxiao'
					})
				},50)
			},
			//购买提交信息
			disBuy(){
				let data={
					buy_info:{}
				};
				data.pay_type=this.pay_type;
				if(this.pro.dis_config.Level_Form){
					if(this.pro.dis_config.Reserve_DisplayName==1){
						data.buy_info.Reserve_DisplayName=this.shenArr.DisplayName;
					}
					if(this.pro.dis_config.Reserve_DisplayTelephone==1){
						data.buy_info.Reserve_DisplayTelephone=this.shenArr.DisplayTelephone;
					}
					if(this.select_lists.length>0){
					
						for(let item of this.select_lists){
							let arr={};
							arr[item.name]=item.options[item.index];
							data.buy_info[item.arrs]=arr;
						}
					}
					if(this.text_lists.length>0){
						for(let item of this.text_lists){
							let arr={};
							arr[item.Name]=item.Value;
							data.buy_info[item.arrs]=arr;
						}
					}
				}
				if(this.pro.dis_config.Distribute_AgreementOpen){
					if(this.isAgree){
						data.agent_promise=1;
					}
				}
				data.buy_level_id=this.pro.dis_level[this.current].Level_ID;
				data.buy_info=JSON.stringify(data.buy_info);
				if(this.pay_type=='remainder_pay'){
					data.user_pay_password=this.user_pay_password;
				}else{
					if(!this.userInfo.openid){
						data.code=this.code;
					}
				}
				
				if(this.pay_type=='remainder_pay'){

					disBuy(data).then(res=>{
						this.paySuccessCall(res)
					},err=>{
						uni.showToast({
							title:res.msg,
							icon:'none'
						})
					}).catch(e=>{
						console.log(e);
					})

				}else if(this.pay_type=='ali_app'){

						disBuy(data).then(res=>{
							//公众号麻烦一点
							if(isWeiXin()){
								let users_id = ls.get('users_id');


								let fromurl = res.data.arg;//encodeURIComponent(res.data.arg);
								let origin = location.origin;



								fromurl = fromurl.replace(/openapi.alipay.com/,'wangjing666')
								console.log(fromurl);

								let str = origin+`/fre/pages/pay/wx/wx?users_id=${users_id}&formurl=`+encodeURIComponent(fromurl);
								let url = str;


								uni.navigateTo({
									url:`/pages/pay/wx/wx?users_id=${users_id}&formurl=`+encodeURIComponent(fromurl)
								})

								console.log(url)
								//这样就避免了users_id瞎跳的机制
								//location.href = url;
							}else{
								document.write(res.data.arg)
								document.getElementById('alipaysubmit').submit()
							}


							return;
						},err=>{
							uni.showToast({
								title:res.msg,
								icon:'none'
							})
						}).catch(e=>{
							console.log(e);
						})
				}else{
					//不用余额调微信支付
					this.wechatPay(data);
				}


			},
			becomeFenxiao(){
				let arr=true;
				if(this.pro.dis_config.Level_Form){
					if(this.pro.dis_level[0].Distribute_Form.DisplayName==1&&this.shenArr.DisplayName==''){
						uni.showToast({
							title:"姓名不能为空",
							icon:'none'
						})
						arr=false;
					}else{
						if(this.pro.dis_level[0].Distribute_Form.DisplayTelephone==1&&this.shenArr.DisplayTelephone==''){
							uni.showToast({
								title:"电话不能为空",
								icon:'none'
							})
							arr=false;
						}else if(this.pro.dis_level[0].Distribute_Form.DisplayTelephone==1&&!(/^1[3456789]\d{9}$/.test(this.shenArr.DisplayTelephone))){
							uni.showToast({
								title:'手机号输入错误，请重新输入',
								icon:"none"
							})
							arr=false;
						}else{
							//循环判断输入框
							if(this.text_lists.length>0){
								for(let item of this.text_lists){
									if(item.Value==''){
										uni.showToast({
											title:item.Name+'不能为空',
											icon:"none"
										})
										arr=false;
									}
								}
							}
						}
					}
				}
				if(this.pro.dis_config.Distribute_AgreementOpen){
					if(!this.isAgree){
						uni.showToast({
							title:"未同意须知",
							icon:'none'
						})
						return;
					}
				}
				if(arr){
					this.$refs.popupLayer.show();
				}
			},
			//跳转商品详情
			goDetail(item){
				uni.navigateTo({
					url:'../detail/detail?Products_ID='+item
				})
			},
			//跳转去列表页
			goResult(){
				uni.navigateTo({
					url:'../result/result'
				})
			},
			application(){
				if(this.submitM){
					uni.showToast({
						title:'当前不可申请',
						icon:'none'
					})
					return;
				}

				let arr=true;
				if(this.pro.dis_config.Level_Form){
					if(this.pro.dis_level[0].Distribute_Form.DisplayName==1&&this.shenArr.DisplayName==''){
						uni.showToast({
							title:"姓名不能为空",
							icon:'none'
						})
						arr=false;
					}else{
						if(this.pro.dis_level[0].Distribute_Form.DisplayTelephone==1&&this.shenArr.DisplayTelephone==''){
							uni.showToast({
								title:"电话不能为空",
								icon:'none'
							})
							arr=false;
						}else if(this.pro.dis_level[0].Distribute_Form.DisplayTelephone==1&&!(/^1[3456789]\d{9}$/.test(this.shenArr.DisplayTelephone))){
							uni.showToast({
								title:'手机号输入错误，请重新输入',
								icon:"none"
							})
							arr=false;
						}else{
							//循环判断输入框
							if(this.text_lists.length>0){
								for(let item of this.text_lists){
									if(item.Value==''){
										uni.showToast({
											title:item.Name+'不能为空',
											icon:"none"
										})
										arr=false;
									}
								}
							}
						}
					}
					//判断地址
					if(this.pro.dis_level[0].Distribute_Form.DisplayLocaltion==1&&arr){
						if(JSON.stringify(this.address_info) == "{}"){
							uni.showToast({
								title:"地址不能为空",
								icon:'none'
							})
							arr=false;
						}else{
							for(let item in this.address_info){
								if(this.address_info[item]==0){
									uni.showToast({
										title:"地址还没有选择",
										icon:'none'
									})
									arr=false;
								}
							}
						}
					
					}
					
				}
				
				if(this.pro.dis_config.Distribute_AgreementOpen){
					if(!this.isAgree){
						uni.showToast({
							title:"未同意须知",
							icon:'none'
						})
						return;
					}
				}
				//是否同意购买须知
				if(arr){
					let apply_info={};
					if(this.pro.dis_level[0].Distribute_Form.DisplayName==1){
						apply_info.DisplayName=this.shenArr.DisplayName;
					}
					if(this.pro.dis_level[0].Distribute_Form.DisplayTelephone==1){
						apply_info.DisplayTelephone=this.shenArr.DisplayTelephone;
					}
					if(this.pro.dis_level[0].Distribute_Form.DisplayLocaltion==1){
						apply_info.DisplayLocaltion={};
						apply_info.DisplayLocaltion.pro_id=this.address_info.Address_Province;
						apply_info.DisplayLocaltion.city_id=this.address_info.Address_City;
